import numpy
scale = 1.0/20.0
n_cells = len(raw_data)
pos = range(n_cells)
dirs = range(n_cells)
lens = range(n_cells)
rads = range(n_cells)
k = 0
for i, l, p, r, ends in raw_data:
    e1,e2 = map(numpy.array, ends)
    pos[k] = (p[0]*scale, p[1]*scale, p[2]*scale, 0.0)
    axis = e2-e1
    axis_len = numpy.sqrt(numpy.vdot(axis, axis))
    dtmp = axis / axis_len
    dirs[k] = (dtmp[0], dtmp[1], dtmp[2], 0.0)
    lens[k] = l * scale
    rads[k] = r * scale * 2.0
    k = k+1
